export default class ReferEarn extends React.PureComponent {
    constructor(props) {
        super(props);
        this.shareApp = this.shareApp.bind(this);
        this.renderItems = this.renderItems.bind(this);
        this.state = {
            loading: false,
            coupon: '',
            wallet: 0,
            userData: {},
            progressloader: false,
            dataList: [],
        }
    }

    componentDidMount() {
        const { navigation } = this.props;
        this.willfocusListener = navigation.addListener("willFocus", () => {
            this.setState({ loading: true, });
        });
        this.focusListener = navigation.addListener("didFocus", () => {
            this.setState({ loading: false, progressloader: true });
            this.fetchdata();
        });
    }

    fetchdata = () => {
        Pref.getVal(Pref.userID, userID => {
            const id = Helper.removeQuotes(userID);
            //console.log('id', id);
            if (id !== '') {
                Helper.networkHelper(Pref.FetchTxWallet, JSON.stringify({
                    userid: id,
                }), Pref.methodPost, value => {
                    //₹
                    const { txdata } = value;
                    this.setState({ coupon: Lodash.capitalize(value.coupon), wallet: Number(value.wallet), dataList: [], progressloader: false });
                }, error => {
                    this.setState({ wallet: Number(0), dataList: value.txdata, progressloader: false });
                });
            }
        })
    }

    componentWillUnMount() {
        if (this.focusListener !== undefined)
            this.focusListener.remove();
        if (this.willfocusListener !== undefined)
            this.willfocusListener.remove();
    }

    /**
     * 
     * @param {*} item 
     * @param {*} index 
     */
    renderItems(item, index) {
        const count = index + 1;
        return (<View styleName='horizontal' style={{
            marginVertical: sizeHeight(1),
            justifyContent: 'space-between', paddingVertical: sizeHeight(0.5), flex: 1
        }}>
            <Title style={{
                marginStart: 12,
                fontSize: 16,
                fontFamily: 'Rubik',
                color: '#292929',
                padding: 4,
                fontWeight: '700',
                flex: 0.25
            }}>{count + ". "}</Title>
            <Subtitle style={{
                fontSize: 16,
                fontFamily: 'Rubik',
                color: '#292929',
                padding: 4,
                fontWeight: '400',
                flex: 0.3
            }}>{item.name}</Subtitle>
            <Subtitle style={{
                fontSize: 16,
                fontFamily: 'Rubik',
                color: item.status === 'credit' ? Colors.green500 : Pref.RED,
                padding: 4,
                fontWeight: '400',
                flex: 0.25
            }}>{`₹${item.amount}`}</Subtitle>
            <Subtitle numberOfLines={1} style={{
                marginEnd: 12,
                fontSize: 16,
                fontFamily: 'Rubik',
                color: Number(item.admin_approve) === 1 ? Colors.blue500 : Number(item.admin_approve) === 2 ? Colors.green500 : Number(item.admin_approve) === 3 ? Pref.RED : Colors.grey400,
                padding: 4,
                fontWeight: '400',
                flex: 0.2
            }}>{`${item.status === 'Debit' ? Number(item.admin_approve) === 1 ? 'Pending' : Number(item.admin_approve) === 2 ? 'Approved' : Number(item.admin_approve) === 3 ? 'Decline' : '---' : '---'}`}</Subtitle>
        </View>)
    }

    shareApp = () => {
        //https://play.google.com/store/apps/details?id=com.erb
        const url = "data:image/png;base64,";
        const title = 'ERB';
        const message = `Hi,Download and install ERB app\nERB is one stop shop for all your financial needs!\n\nApply my referral code "${this.state.coupon}" to get 500₹ in your wallet\nhttps://play.google.com/store/apps/details?id=com.erb`;
        const options = Platform.select({
            ios: {
                activityItemSources: [
                    {
                        placeholderItem: { type: 'url', content: url },
                        item: {
                            default: { type: 'url', content: url },
                        },
                        subject: {
                            default: title,
                        },
                        linkMetadata: { originalUrl: url, url, title },
                    },
                    {
                        placeholderItem: { type: 'text', content: message },
                        item: {
                            default: { type: 'text', content: message },
                            message: null, // Specify no text to share via Messages app.
                        },
                    },
                ],
            },
            default: {
                title,
                subject: title,
                url: url,
                message: `${message}`,
            },
        });
        Share.open(options);
    }

    render() {
        return (
            <CommonScreen
                title={'My Wallet'}
                loading={this.state.loading}
                backgroundColor={'white'}
                body={
                    <>
                        <LeftHeaders
                            //showAvtar
                            //rightImage={false}
                            //url={require('../../res/images/moneywallets.png')}
                            title={'Refer&Earn'}
                            showBack
                        // bottomBody={
                        //     <View style={{ marginStart: 64, flexDirection: 'row', justifyContent: 'space-between', alignContents: 'center', alignItems: 'center' }}>
                        //         <Title style={{
                        //             fontSize: 17, fontFamily: 'Rubik', letterSpacing: 1, color: 'white', alignSelf: 'flex-start', fontWeight: '400', paddingVertical: sizeHeight(0.5),
                        //         }}> {'Manage your wallets'}</Title>
                        //     </View>
                        // }
                        />

                        <CardVertical
                            elevation={0}
                            cardStyle={{ paddingHorizontal: 0, paddingVertical: 0, marginHorizontal: 0, borderRadius: 0, justifyContent: 'center', flex: 1,marginVertical:sizeHeight(4) }}
                            // color={'#442185'}
                            url={require('../../res/images/refernew.jpg')}
                            title={'Invite a Friend'}
                            subtitle={`refer a friend to get 500₹`}
                            titleColor={'#292929'}
                            subtitleColor={'#292929'}
                            bottom={<View style={{ flexDirection: 'row', flex: 1, paddingVertical: sizeHeight(3), alignContents: 'center', justifyContent: 'center', marginTop: sizeHeight(1) }}>
                                <View style={{ flex: 0.3 }}></View>
                                <View style={{ borderWidth: 0.4, 
                                    borderColor: Colors.grey500, 
                                    borderRadius: 6, 
                                    flex: 0.5, flexDirection: 'row', justifyContent: 'space-between', paddingVertical: sizeHeight(1.5), paddingHorizontal: 16,marginVertical:16}}>
                                    <Subtitle style={{ color: '#292929', fontSize: 18, fontFamily: 'Rubik', alignSelf: 'center', marginHorizontal: 0, fontWeight: '700' }}>{this.state.coupon}</Subtitle>
                                    <TouchableWithoutFeedback onPress={() => {
                                        Clipboard.setString(this.state.coupon)
                                        Helper.showToastMessage('referral code copied', 1);
                                    }}>
                                        <Icon name='copy' size={24} color={'#292929'} style={{ marginEnd: 0, alignSelf: 'center' }} />
                                    </TouchableWithoutFeedback>
                                </View>
                                <TouchableWithoutFeedback onPress={() => this.shareApp()}>
                                    <Icon name='share-2' size={24} color={'#292929'} style={{ marginHorizontal: 10, alignSelf: 'center' }} />
                                </TouchableWithoutFeedback>
                                <View style={{ flex: 0.2 }}></View>
                            </View>}
                        />

                    </>
                }
            />
        );
    }
}


